  input: '"TEXT","F3XA","C00140590","Laura Sinram     RE California Republican Party
    /V8  ID C00140590  February Monthly (01/1/07- 1/31/07)    Dear Ms. Sinram    In
    response to your inquiry dated November 9, 2007 listed below are our responses.    As
    we discussed on a telephone call with you, our software program is forcing two
    separate H1 schedules to be printed for the following reason. There are joint
    activity payments reported in this report which deal with two different allocations.   The
    2006 administrative expenses are reported at 79-21% and reported as                          Administration
    B3. The 2007 administrative expenses are reported at 72-28% and reported as Admin
    2007.    We have filed an amended report which updates some of the missing contributor
    information. Please note that we enter the name of employer and occupation exactly
    as the donor represents it to us. However we have taken steps to ensure that the
    best efforts procedure, which is outlined in detail below, will also be followed
    when the donor responds; but responds inadequately. For example when they respond
    Self/Business Owner as their overall response, the committee will send up a follow
    up letter as outlined below.    We have moved the negative disbursement which
    was for a refund of payroll taxes which were inadvertently drawn out of our account
    by our payroll company In January. The excess withdrawal was previously and still
    is shown on Schedule B. The deposit back of the error is now shown as an Offset
    to Operating Expenses on line 15.    We have also fixed the computer glitch which
    was generating multiple schedule H1s.    Listed below is our committees procedures
    to address the disclosure issue regarding contributions.     First, our original
    solicitation does include a clear and conspicuous request for the contributor
    information and does inform the contributor of the requirements of Federal Law
    for such reporting information.    Second, when contributions are received with
    the requesting information not provided; we send a separate letter, which clearly
    asks for the missing information without soliciting a contribution. We once again
    inform the contributor of the requirements of the Federal Law for the reporting
    of such information and we provide a return envelope for the benefit of the contributor.      We
    file amended reports when we receive updated information.    Based on the above
    the committee believes it is complying with the best efforts requirements of the
    law.    Sincerely,  Fred Arjani        "'
